package com.sing.ren.pojo;public class CoursesTime extends BasePOJO{	private Integer id;	private String interval;	private String startTime;	private String endIme;	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public String getInterval() {		return interval;	}	public void setInterval(String interval) {		this.interval = interval;	}	public String getStartTime() {		return startTime;	}	public void setStartTime(String startTime) {		this.startTime = startTime;	}	public String getEndIme() {		return endIme;	}	public void setEndIme(String endIme) {		this.endIme = endIme;	}}